{
    "query": "

query Vendas($startDate: Date!, $endDate: Date!) {
                myClinic {
                    sales(
                        startDate: $startDate, 
                        endDate: $endDate,
                    ) {
                        records {
                            id,
                data_da_venda: saleDate,
                payments {amount {value}, method {name}},
                            items {
                            billedPrice {value},
                            billedAmount {value}, 
                            discount {value}, # desconto vem zerado mesmo quando existe
                            ...on VaccineShot {
                                tipo: __typename,
                                aplicada: isVaccineShotStatus(status: APPLIED),
                                agendada: isVaccineShotStatus(status: SCHEDULED),
                                data_aplicado_ou_agendado: date,
                                vaccine {id, name},

                                manufacturer {name},
                                ...on AppliedVaccineShot {
                                    batch {code}
                                }
                            },
                            }
                        }
                    }
                }
            }",
    "operationName": "Vendas",
    "variables": {
        "startDate": "2023-11-10T00:00:00.000000+00:00",
        "endDate": "2023-11-12T23:23:59.000000+00:00"
    }
}

